import { Route, Routes } from 'react-router-dom';
//import MainPage from './pages/MainPage';
import PhoneNumPage from './pages/PhoneNumPage';

function App() {
    return (
        <>
            <Routes>
                <Route path="/" element={<PhoneNumPage />} />
                <Route path="/phonenum" element={<PhoneNumPage />} />
            </Routes>
        </>
    );
}

export default App;
